import React from 'react'
import { Container } from 'react-bootstrap'
import styled from 'styled-components'

const Team = () => {
    const Teamsection=styled.section`
            height:100%;
            background:${({theme})=>theme.colors.text2};
            background-size:50%;
            padding-top:100px;
            .parent{
                height:100vh;
            }
    
    `;
  return (
    <Teamsection>
        <Container>
            <div className='parent'>
                <h1>our main team </h1>
            </div>
        </Container>
    </Teamsection>
  )
}

export default Team
